import Rooms from './Rooms';
import { createMuiTheme } from '@material-ui/styles';
import { red, blue } from '@material-ui/core/colors';

const customTheme = createMuiTheme({
    palette: {
        primary: red,
        secondary: blue
    }
})


const RoomsPage = () => {
    <ThemeProvider theme={customTheme}>
        <Rooms {...args}/>
    </ThemeProvider>
}
